import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

// Import your AppProvider from contexts folder
import { AppProvider } from './contexts/AppContext';

// Create root and render the App component wrapped with AppProvider
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <AppProvider>
    <App />
  </AppProvider>
);
